module.exports = {
	"posts": [
		{
			"title": "Nick Johnston's Gallery of the fine arts",
			"thumbnail": "http://imgur.com/7Gehs9G.jpg",
			"blerb": "I spent like eight hours on this in highschool, it was actually for a photography class. Notice how the skin blends into itself and how the glasses are still on without being clipped.",
			"cards": [
				{
					"img": "http://imgur.com/WaDnELd.jpg",
					"info": "This is probably what the first colonists saw back in the day. The Canadian flag ripples boldly in the air as the ghosts of Tim Hortons and Maple Syrup observe a clash between spectral polar bears. The RCMP officer esures the fight stays clean"
				},
				{
					"img": "http://imgur.com/IwHu8MM.jpg",
					"info": "I remember having about fifty different tabs open while making this, each one dedicated to a different layering issue I was having at the time. In the end I think my solution was to clip a mask made from the lines of contrast and then to place it over a smoke jpg, then I think I added smoke images to replace my hair"
				},
				{
					"img": "http://imgur.com/QeXm29K.jpg",
					"info": "Actually this one was done in adobe illustrator, I was using vector art to draw polygons over areas with marginally different shading. I'm not too sure I like how it turned out come to think of it. The nose looks like it's about to fall off. Anyway, the background turned out really neat, I made it by taking the letter N and mirroring it, then mirroring that, and eventually made this diamond-ish pattern."
				}
			],
			"paragraphs": [
				"Looking back on my highschool experience I realize that photoshop has alwasy been my primary artistic outlet.",
				"Modern schools face the challenge of balancing art programs with more modern subjects like computer science and IT literacy and as a result one of those two things will often thrive at the exprense of the other. Honestly the more I've thought about it the more I've come to realize that art classes should be taught in a digital medium.",
				"I'm not trying to bash traditional artisitc disiplines like paint or chalk, but you have to realize those art styles are probably past their prime. Most art students today have to learn a digital medium at some point or another anyway. Most of the paying jobs in artistic fields involve digital mediums as well.",
				"I would argue that photoshop is probably the most fun of all the digital media generation tools. As far as programs go it's fair in the sense that you'll get out of it what you put into it. From a begginners perspective it also has the advantage of showing immediate results for little to no cost, where as something like a film editing requires hours of initial set up and props and actors. Photoshop is probably the most egalitarian form of modern expression there is, at least in my opinion.",
				"Opinions aside the reason I'm posting these is to test the post function of the website, hopefully these paragrpahs load in the correct order from the .json file and the images are paginated correctly above. The othe rmemeber of Das Studio is Haseeb, and his posts are mainly going to be about his art portfolio and these photoshop post seem like a good test of what an artist would need from a portfolio written in Angular 2. I know the production build for the site has it's code zipped and minified so expect me to post source code for this site once it's exited the alpha build phase."
			]
		}
	]
};

